from networkStructure import *
import numpy as np
from networkUtil import * 

# Client classes

## class Client_IoTSet
class Client_IoTSet(ClientAbstract):
	def __init__(self, id, schedule, locations, fileSize_mb = 0, local_CPU_ghz = 0.0, localProcessing_ms = 0, storageReq_mb = 0, ramReq_mb = 0, communicationRadius_m = np.infty):
		self.client_type = "IoTSet"
		self.id = id
		self.schedule = schedule
		self.locations = locations
		self.fileSize_mb = fileSize_mb
		self.local_CPU_ghz = local_CPU_ghz
		self.localProcessing_ms = localProcessing_ms
		self.storageReq_mb = storageReq_mb
		self.ramReq_mb = ramReq_mb
		self.communicationRadius_m = communicationRadius_m
# Defines the attribute that represents the radius (in metres), if any.
	def get_radius(self):
	# The communicationRadius_m attribute represents the radius.
		return self.communicationRadius_m

# List the available attributes
	def list_attributes(self):
		return ['fileSize_mb','local_CPU_ghz','localProcessing_ms','storageReq_mb','ramReq_mb','communicationRadius_m']

class Graph_Edge(GraphAbstract):
	def __init__(self, id, nodes, links):
		self.id= id
		self.nodes = nodes
		self.links=links
		self.paths = depthFirstSearch(self.nodes.get_nodes())

# Link classes for specific attribute set
class Node_EdgeSet(NodeAbstract):
	def __init__(self,id,locations,local_CPU_ghz = 0.0,localProcessing_ms = 0,storageAvail_mb = 0,ramAvail_mb = 0,communicationRadius_m = np.infty):
		self.node_type = "EdgeSet"
		self.id = id
		self.locations = locations
		self.local_CPU_ghz = local_CPU_ghz
		self.localProcessing_ms = localProcessing_ms
		self.storageAvail_mb = storageAvail_mb
		self.ramAvail_mb = ramAvail_mb
		self.communicationRadius_m = communicationRadius_m
		self.neighbours = []

# Defines the attribute that represents the service rate, if any.
	def get_service_rate(self):
# The local_CPU_ghz attribute represents the service rate.
		return self.local_CPU_ghz
# Defines the attribute that represents the radius (in metres), if any.
	def get_radius(self):
# The communicationRadius_m attribute represents the radius.
		return self.communicationRadius_m

# List the available attributes
	def list_attributes(self):
		return ['local_CPU_ghz','localProcessing_ms','storageAvail_mb','ramAvail_mb','communicationRadius_m']


# Link classes for specific attribute set
class Link_EdgeLinks(LinkAbstract):
	def __init__(self,id,node_pair,bandwidth = 0.0):
		self.link_type = "EdgeLinks"
		self.id = id
		self.node_pair = node_pair
		self.bandwidth = bandwidth

# List the available attributes
	def list_attributes(self):
		return ['bandwidth']

